<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF">  ~</span><span style="--shiki-light:#6F42C1;--shiki-dark:#61AFEF">Dog</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF">() </span></span>
